import React from 'react';
import styled from "styled-components";
import {RowContainer} from "../components/header/header";
import Text from "../theme/text";
import Link from "../theme/link";
import Button from "../theme/button";
import Trash from "../components/page-components/bags/images/trash.png"
import Image from "../theme/image";
import Plus from "../components/page-components/bags/images/plus.png"

const ModRowContainer = styled(RowContainer)`
  justify-content: space-between;
  flex-wrap: wrap;
`;

const Data = [{
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
}, {
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
}, {
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
},{
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
},{
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
}, {
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
},{
    name: "Negev",
    used: 2,
    place: 5,
    benefit: 5345.4
},]

const Bags = () => {
    return (
        <>
            <ModRowContainer style={{marginBottom: "25px", marginTop: "40px"}}>
                <div style={{borderRadius: "10px", backgroundColor: "#DDDDDD", padding: "10px 15px"}}>
                    <Text color={"black"} fontSize={"20px"}>
                        Investment bags: 1/2
                    </Text>
                </div>
                <Text color={"black"} fontSize={"14px"}>
                    Wanna create more? <Link to="#"><u>Upgrade to pro</u></Link>
                </Text>
            </ModRowContainer>
            <ModRowContainer>
                {Data.map((item) => (
                    <div style={{padding: "18px", backgroundColor: "#DDDDDD", borderRadius: "10px", marginBottom: "30px"}}>
                        <ModRowContainer style={{marginBottom: "25px"}}>
                            <div style={{padding: "9px 7px", backgroundColor: "white", borderRadius: "5px"}}>
                                <Text fontSize={"16px"} color={"black"}>
                                    Name: {item.name}
                                </Text>
                            </div>
                            <div style={{padding: "9px 7px", backgroundColor: "white", borderRadius: "5px"}}>
                                <Text fontSize={"16px"} color={"black"}>
                                    Items: {item.used}/{item.place}
                                </Text>
                            </div>
                        </ModRowContainer>
                        <div style={{
                            backgroundColor: "#FEC3C3",
                            padding: "28px 64px",
                            borderRadius: "5px",
                            marginBottom: "70px"
                        }}>
                            <Text fontSize={"16px"} color={"black"}>
                                Overall benefit: {item.benefit}$
                            </Text>
                        </div>
                        <ModRowContainer>
                            <Button padding={"9px 9px"} background={"white"} border={"black"}>
                                <Text color={"black"} fontSize={"16px"}>
                                    More info
                                </Text>
                            </Button>
                            <Button padding={"6px 7px"} background={"white"} border={"black"}>
                                <Image width={22} src={Trash}/>
                            </Button>
                        </ModRowContainer>
                    </div>
                ))}
            </ModRowContainer>
            <div style={{textAlign: "center"}}>
                <Button padding={"0 5px"} border={"black"} background={"#DDDDDD"}>
                    <Image src={Plus}/>
                </Button>
            </div>
        </>
    )
}

export default Bags;
